import React from 'react'
import Header from './Header'
import './Home.css';

export default function About() {
  return (
    <div>
        <Header />
        <div  className='mainHomeDiv'>
        <div style={{backgroundColor:"#d32f2f", height:"10%", width:"90%", borderRadius:"25%", margin:"0",padding:"10%"}}>
            <h1>GST BILLING APP</h1>
        </div>
        </div>
    </div>
  )
}
